tweets.text:
👉 As ultrapassagens perigosas podem ser causas de diversos acidentes. 

🚙 Confira algumas dicas de como ultrapassar de maneira segura:

✔️ Respeite as sinalizações de faixa;
✔️ Sinalize sua manobra;
✔️ Escolha um momento adequado para realizá-la. https://t.co/FKkXcSrt4J

Vai levar alguém na garupa da moto? 🏍️

👉 Confira algumas dicas:

✅ Evite acelerações e frenagens bruscas;
✅ O capacete é obrigatório para os dois ocupantes;
✅Oriente o ocupante da garupa a ficar mais próximo de você para evitar desequilíbrio. https://t.co/h8Wx0U9izb

Motociclista, a #Ecoponte tem dicas para você! 🏍

Utilize o capacete e peça para o passageiro também utilizar;
Use a viseira do capacete;
Sempre verifique a moto antes de sair;
Respeite os limites de velocidade. 

Boa viagem! 🌉💚 https://t.co/EPtVF4GA6n

Ei motociclista, sabe como começar bem o dia? 🏍️

Utilize o capacete;
Lembre-se que o uso dos dois retrovisores é obrigatório;
Use a viseira do capacete. https://t.co/IOYLVSdmtf
